import React, { Component } from 'react';
import Gallery from "react-photo-gallery";

class Project extends Component {
  render() {
    return (
      <div>
        <div style={Style.space}>
          <div className="container">
            <div>
              <h2 style={Style.headText}>TravelEasy</h2>
              <p style={Style.headText}>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean
              commodo ligula eget dolor. Aenean massa. Cum sociis natoque penatibus et magnis dis parturient
              montes, nascetur ridiculus mus. Donec quam felis, ultricies nec, pellentesque eu, pretium quis,
              sem. Nulla consequat massa quis enim. Donec pede justo, fringilla vel, aliquet nec, vulputate
              eget, arcu. In enim justo, rhoncus ut, imperdiet a, venenatis vitae, justo. Nullam dictum felis
                eu pede mollis pretium. Integer tincidunt. Cras dapibus. Vivamus elementum semper nisi. </p>
            </div>
          </div>
        </div>
        <div style={Style.bgc}>
          <div className="container">
            <div style={Style.gallery}>
              <div style={Style.right}>
                <img src={require('./imgs/signup.png')} alt="homepage" />
              </div>
              <div style={Style.right}>
              <h2 style={Style.text}>Log In</h2>
              </div>
              {/* <div>
                <img src={require('./imgs/Explore.png')} alt="homepage" />
              </div>
              <div>
                <img src={require('./imgs/Trip.png')} alt="homepage" />
              </div>
              <div>
                <img src={require('./imgs/user.png')} alt="homepage" />
              </div> */}
            </div>
          </div>
        </div>
      </div>

    );
  }
}

const Style = {
  headText: {
    textAlign: "center",
    paddingTop: "10px"
  },

  bgc: {
    backgroundColor: "#414154",
    paddingBottom: "30px"
  },
  space: {
    paddingBottom: "20px"
  },
  gallery: {
    display: "table"
  },
  right: {
    // float: "right",
    width: "50%",
    verticalAlign: "middle",
    display: "table-cell",
    textAlign: "center"
  },
  text: {
    textAlign: "center"
  }
};


export default Project;
